import './App.css';
import Moviecard from './components/card/Moviecard';
import Movielist from './components/movielist/Movielist';


function App() {
  return (
    <div>{

      Movielist.map((item) => {
        return <Moviecard title={item.title} year={item.year} director={item.director} duration={item.duration} genre={item.genre} rate={item.rate} />
      })
    }</div>);

}

export default App;
